import styled from 'styled-components';

const ScalableGrid = styled.div `
    // width: ${props=>props.gridSide*10}px;
    justify-content: flex-start
    display: grid;
    grid-column-gap: 0;
    grid-template-columns: repeat(${props=>props.gridSide}, 1fr);
`;

export {ScalableGrid}
